import React from 'react';
import { CoinName, CoinDisplayDiv, CoinImage, CoinRank, HourChange, CoinPrice, DayChange, WeekChange, VolumeMarket, CirculatingSupply, Last7d } from './styles';

export default function CoinTableData(props) {
    return(
        <CoinDisplayDiv>
            <CoinRank>{props.market_cap_rank}</CoinRank>
            <CoinImage src={props.image}></CoinImage>
            <CoinName>{props.name}</CoinName>
            <CoinPrice>{props.current_price}</CoinPrice>
            <HourChange>{props.hourchange.toFixed(2)}</HourChange>
            <DayChange>{props.daychange.toFixed(2)}</DayChange>
            <WeekChange>{props.weekchange.toFixed(2)}</WeekChange>
            <VolumeMarket></VolumeMarket>
            <CirculatingSupply></CirculatingSupply>
            <Last7d></Last7d>
        </CoinDisplayDiv>
    )
}
